.align 2


tv_tuner_01_setup:
  stp     x29, x30, [sp, #-16]!                   // Push frame pointer, procedure link register on stack.
  mov     x29, sp                                 // Update frame pointer to new stack location.
  _strh   0x01, (STRMS+0x0a)
  _str    tv_tuner_fake_chans, CHANS
  _strb   0x02, DF_SZ                             // lower screen is 2 lines
  strb    wzr, [x28, MASK_P-sysvars]
  strb    wzr, [x28, P_FLAG-sysvars]
  _str    char_set-32*32, CHARS
  adrp    x0, display_file
  add     x0, x0, :lo12:display_file
  adrp    x1, display_file_end
  add     x1, x1, :lo12:display_file_end
1:
  str     xzr, [x0], #0x08
  cmp     x0, x1
  b.ne    1b
  adrp    x0, attributes_file
  add     x0, x0, :lo12:attributes_file
  adrp    x2, attributes_file_end
  add     x2, x2, :lo12:attributes_file_end
2:
  mov     w1, #0x38
  stp     x0, x2, [sp, #-16]!
  bl      poke_address
  ldp     x0, x2, [sp], #16
  add     x0, x0, #0x01
  cmp     x0, x2
  b.ne    2b
# _strb   DUMP_DISPLAY, sp4_test_flags            // Dump display updates to test log
  ldp     x29, x30, [sp], #0x10                   // Pop frame pointer, procedure link register off stack.
  ret

tv_tuner_01_effects:
  stp     x29, x30, [sp, #-16]!                   // Push frame pointer, procedure link register on stack.
  mov     x29, sp                                 // Update frame pointer to new stack location.
  _setbit 0, FLAGS
  _resbit 1, FLAGS
  _resbit 4, FLAGS2
  _strb   0, TV_FLAG
  _strb   0x07, S_POSN_X
  _strb   0x35, S_POSN_Y
  _strb   0x40, ATTR_T
  _strb   0x00, MASK_T
  _strb   0x13, TVDATA
  _str    tv_tuner_fake_chans, CURCHL
  _str    display_file + 8 * 216 - 6*2, DF_CC
  adrp    x0, display_file
  add     x0, x0, :lo12:display_file
  adrp    x1, attributes_file_end
  add     x1, x1, :lo12:attributes_file_end
  adr     x2, tv_tuner_01_display
  mov     x4, #0x20
  adrp    x11, random_block_zeros
  add     x11, x11, :lo12:random_block_zeros
  bl      restore_snapshot
  adrp    x0, framebuffer
  add     x0, x0, :lo12:framebuffer
  ldp     w0, w1, [x0]
  add     x1, x0, x1
  adr     x2, tv_tuner_01_framebuffer
  mov     x4, #0x20
  adrp    x11, random_block_zeros
  add     x11, x11, :lo12:random_block_zeros
  bl      restore_snapshot
  ldp     x29, x30, [sp], #0x10                   // Pop frame pointer, procedure link register off stack.
  ret

tv_tuner_01_effects_regs:
  adrp    x0, attributes_file_end - 20*108 - 2
  add     x0, x0, :lo12:(attributes_file_end - 20*108 - 2)
  mov     w1, wzr
  mov     w2, 0x40
  mov     w3, wzr
  adrp    x4, tvt_data_end
  add     x4, x4, :lo12:tvt_data_end
  mov     w5, 0xcc
  mov     w6, 0xcc
  movl    w7, 0xcccccc
  mov     w8, wzr
  adrp    x9, fb_req
  add     x9, x9, :lo12:fb_req
  mov     w10, 0x6b
  movl    w11, 0x0329ff
  mov     w12, 0x6c
  mov     w13, wzr
  mov     w14, wzr
  mov     w15, wzr
  mov     w16, 0x194f
  mov     w17, 0x38
  mov     w18, 0x0a
  movl    w19, 0x0e8d40
  adrp    x19, attributes_file_end - 8*108
  add     x19, x19, :lo12:(attributes_file_end - 8*108)
  adrp    x20, attributes_file_end
  add     x20, x20, :lo12:attributes_file_end
  mov     x21, x20
  nzcv    0b0110
  ret

